import React from 'react';
import { motion } from 'framer-motion';
import { 
  ClockIcon, 
  MapPinIcon, 
  ArrowRightIcon,
  BuildingOfficeIcon 
} from '@heroicons/react/24/outline';

const SurroundingsSection = () => {
  const attractions = [
    {
      icon: "📍",
      title: "Castelul Peleș",
      distance: "300m",
      duration: "2–3 ore",
      price: "45 RON",
      description: "Arhitectură neorenascentistă",
      image: "https://images.unsplash.com/photo-1544551763-46a013bb70d5?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80"
    },
    {
      icon: "🛕",
      title: "Mânăstirea Sinaia",
      distance: "500m",
      duration: "1–2 ore",
      price: "Gratuit",
      description: "Centru spiritual și cultural",
      image: "https://images.unsplash.com/photo-1506905925346-21bda4d32df4?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80"
    },
    {
      icon: "🚡",
      title: "Telecabina Cota 1400",
      distance: "2km",
      duration: "Flexibil",
      price: "35 RON",
      description: "Vedere panoramică asupra munților",
      image: "https://images.unsplash.com/photo-1544551763-46a013bb70d5?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80"
    },
    {
      icon: "🥾",
      title: "Trasee Bucegi",
      distance: "Variate",
      duration: "2–8 ore",
      price: "Gratuit",
      description: "Explorare montană și naturală",
      image: "https://images.unsplash.com/photo-1506905925346-21bda4d32df4?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80"
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const cardVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: { opacity: 1, y: 0 }
  };

  return (
    <section className="section-padding bg-background-primary">
      <div className="container-custom">
        {/* Section Header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-3xl md:text-4xl lg:text-5xl font-display font-bold text-text-primary mb-4">
            Împrejurimi & Atracții Turistice
          </h2>
          <p className="text-lg text-text-light max-w-2xl mx-auto">
            Descoperă principalele atracții turistice din apropierea hotelului nostru.
          </p>
        </motion.div>

        <div className="grid grid-cols-1 lg:grid-cols-2 gap-12">
          {/* Attractions Cards */}
          <motion.div
            variants={containerVariants}
            initial="hidden"
            whileInView="visible"
            viewport={{ once: true }}
            className="space-y-6"
          >
            {attractions.map((attraction, index) => (
              <motion.div
                key={index}
                variants={cardVariants}
                className="bg-white rounded-2xl overflow-hidden shadow-lg hover:shadow-xl transition-shadow duration-300"
              >
                <div className="flex">
                  {/* Image */}
                  <div className="w-32 h-32 flex-shrink-0">
                    <img
                      src={attraction.image}
                      alt={attraction.title}
                      className="w-full h-full object-cover"
                      loading="lazy"
                    />
                  </div>

                  {/* Content */}
                  <div className="flex-1 p-6">
                    <div className="flex items-start justify-between mb-2">
                      <span className="text-2xl">{attraction.icon}</span>
                      <h3 className="text-xl font-display font-bold text-text-primary flex-1 ml-2">
                        {attraction.title}
                      </h3>
                    </div>

                    <div className="space-y-2 mb-4">
                      <div className="flex items-center space-x-2 text-sm text-text-light">
                        <MapPinIcon className="w-4 h-4" />
                        <span>{attraction.distance}</span>
                      </div>
                      <div className="flex items-center space-x-2 text-sm text-text-light">
                        <ClockIcon className="w-4 h-4" />
                        <span>{attraction.duration}</span>
                      </div>
                      <div className="flex items-center space-x-2 text-sm text-text-light">
                        <BuildingOfficeIcon className="w-4 h-4" />
                        <span>{attraction.price}</span>
                      </div>
                    </div>

                    <p className="text-text-light text-sm mb-4">
                      {attraction.description}
                    </p>

                    <motion.button
                      whileHover={{ scale: 1.02 }}
                      whileTap={{ scale: 0.98 }}
                      className="text-primary-500 font-medium text-sm hover:text-primary-600 transition-colors flex items-center space-x-1"
                    >
                      <span>Află mai multe</span>
                      <ArrowRightIcon className="w-4 h-4" />
                    </motion.button>
                  </div>
                </div>
              </motion.div>
            ))}

            {/* Organize Trip Button */}
            <motion.div
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.8, delay: 0.4 }}
              className="text-center pt-6"
            >
              <motion.button
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
                className="bg-primary-500 text-white px-8 py-4 rounded-xl font-medium hover:bg-primary-600 transition-colors duration-300 text-lg"
              >
                Organizează Excursia
              </motion.button>
            </motion.div>
          </motion.div>

          {/* Interactive Map */}
          <motion.div
            initial={{ opacity: 0, x: 50 }}
            whileInView={{ opacity: 1, x: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.8, delay: 0.2 }}
            className="relative"
          >
            <div className="bg-white rounded-2xl overflow-hidden shadow-lg h-full min-h-[500px]">
              <iframe
                src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2848.8444388077697!2d25.5567!3d45.3497!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40b2b3b3b3b3b3b3%3A0x40b2b3b3b3b3b3b3!2sHotel+Marami%2C+Sinaia!5e0!3m2!1sen!2sro!4v1234567890"
                width="100%"
                height="100%"
                style={{ border: 0, minHeight: '500px' }}
                allowFullScreen=""
                loading="lazy"
                referrerPolicy="no-referrer-when-downgrade"
                title="Hotel Marami Location"
              ></iframe>
            </div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default SurroundingsSection;
